# Enums for EngFrameDataKey
class EngFrameDataKey(Enum):
    IDU_QTY = "idu_qty"
    TSC_NEW = "tsc_new"
    ODU_MODE = "odu_mode"
    MASTER_CAP = "master_cap"
    SLAVE1_CAP = "slave1_cap"
    SLAVE2_CAP = "slave2_cap"
    SLAVE3_CAP = "slave3_cap"
    MASTER_ERR = "master_err"
    SLAVE1_ERR = "slave1_err"
    SLAVE2_ERR = "slave2_err"
    SLAVE3_ERR = "slave3_err"
    SID = "sid"
    MODE = "mode"
    STATUS = "status"
    ERR = "err"
    C_TEMP = "c_temp"
    CAPACITY = "capacity"
    MODEL_NAME = "model_name"
    THERMOSTAT = "thermostat"
    FSPD = "fspd"
    STEMP = "stemp"
    SWING = "swing"
    EXV_STEP = "exv_step"
    DELTA_TCOIL = "delta_tcoil"
    ON_LOCK = "on_lock"
    OFF_LOCK = "off_lock"
    MODE_LOCK = "mode_lock"
    TEMP_LOCK = "temp_lock"
    SLEEP = "sleep"
 
def parser_eng_frame(frame: str) -> dict:
    
    try:
        parsed_data: dict = {
            EngFrameDataKey.IDU_QTY.value : int(frame[7 : 9], 16),
            EngFrameDataKey.TSC_NEW.value : int(frame[27 : 31], 16),
            EngFrameDataKey.ODU_MODE.value : int(frame[43]),
            EngFrameDataKey.MASTER_CAP.value : CAP_TO_DATA.get(frame[61]),
            EngFrameDataKey.SLAVE1_CAP.value : CAP_TO_DATA.get(frame[93]),
            EngFrameDataKey.SLAVE2_CAP.value : CAP_TO_DATA.get(frame[125]),
            EngFrameDataKey.SLAVE3_CAP.value : CAP_TO_DATA.get(frame[157]),
            EngFrameDataKey.MASTER_ERR.value : frame[401 : 403],
            EngFrameDataKey.SLAVE1_ERR.value : frame[470 : 472],
            EngFrameDataKey.SLAVE2_ERR.value : frame[539 : 541],
            EngFrameDataKey.SLAVE3_ERR.value : frame[608 : 610],
            EngFrameDataKey.SID.value : int(frame[4781 : 4783], 16)
        }
    except Exception as e:
        print(f"An error occurred: {e}")
        return {}

    # IDU
    parsed_data["idus"] = []
    for i in range(0, parsed_data[EngFrameDataKey.IDU_QTY.value]):
        num = i * 65

        try:
            idu = {
                EngFrameDataKey.MODE.value :  int(frame[751 + num]),
                EngFrameDataKey.STATUS.value :  int(frame[752 + num]),
                EngFrameDataKey.ERR.value : frame[753 + num : 755 + num],
                EngFrameDataKey.C_TEMP.value : f"{int(frame[760 + num : 764 + num], 16) / 10}",
                EngFrameDataKey.CAPACITY.value : CAPACITY_TO_DATA.get(frame[768 + num]),
                EngFrameDataKey.MODEL_NAME.value : frame[769 + num],
                EngFrameDataKey.THERMOSTAT.value : int(frame[778 + num]),
                EngFrameDataKey.FSPD.value : int(frame[780 + num]),
                EngFrameDataKey.STEMP.value : f"{int(frame[781 + num : 783 + num], 16)}",
                EngFrameDataKey.SWING.value : {
                    "value" : int(frame[785 + num]),
                    "pos" : int(frame[784 + num])
                },
                EngFrameDataKey.EXV_STEP.value : f"{frame[786 + num]}{int(frame[787 + num : 791 + num], 16)}",
                EngFrameDataKey.DELTA_TCOIL.value : f"{int(frame[791 + num : 795 + num], 16) / 10}",
                EngFrameDataKey.ON_LOCK.value : int(frame[800 + num]),
                EngFrameDataKey.OFF_LOCK.value : int(frame[801 + num]),
                EngFrameDataKey.MODE_LOCK.value : int(frame[802 + num]),
                EngFrameDataKey.TEMP_LOCK.value : int(frame[803 + num]),
                EngFrameDataKey.SLEEP.value : int(frame[812 + num])
            }
            parsed_data["idus"].append(idu)
        except:
            continue

    return parsed_data

